import './App.css';
import DE2Component from "./Components/DE2Component";
import LedEditor from "./Components/LedEditor";

function App() {
  return (
    <div className="App">
      <div className='container'>
          <div className='row1'>
            <div className='blank'/>
            <div className='blank'/>
            <div className='blank'/>
          </div>
          <div className='row2'>
            <div className='blank'/>
            <DE2Component/>
            <div className='blank'/>
          </div>
          <div className='row3'>
            <div className='blank'/>
            <LedEditor/>
            <div className='blank'/>
          </div>
      </div>
    </div>
  );
}

export default App;
